import React from 'react';

const Button = ({text, onClick}) => {
    return (
        <button onClick={onClick}
        type="submit"
        className="px-[20px] py-[12px] text-[20px] text-white bg-[#1DB688] hover:bg-gradient-to-r from-green-500 via--300 to-green-900 rounded-[100px] "
      >
        {text}
      </button>
    );
}

export default Button;
